// ExportToExcel.js
import React from 'react';

function ExportToExcel({ onExport }) {
  return (
    <div>
      <h3>Export to Excel</h3>
      <button onClick={onExport}>Export</button>
    </div>
  );
}

export default ExportToExcel;
